import React, { Component } from 'react'
import {NavLink,Collapse,Navbar,NavbarToggler,NavbarBrand,Nav,NavItem} from 'reactstrap';
import '../Navbar/NavBar.css'

class NavBar extends Component {
    constructor(props) {
        super(props);
    
        this.toggleNavbar = this.toggleNavbar.bind(this);
        this.closeNavbar = this.closeNavbar.bind(this);
        this.state = {
        collapsed: true
        };
    }
    
    toggleNavbar() {
        this.setState({
        collapsed: !this.state.collapsed
        });
    }
    
    closeNavbar() {
        if (this.state.collapsed !== true) {
        this.toggleNavbar();
        }
    }
  render (){
    return (
        <div className="Header">
        <div className="Nav">
        <Navbar className="navbar navbar-expand-sm navbar-light fixed-top ">
       <NavbarBrand tag={NavLink} to="/"> </NavbarBrand>
       <NavbarToggler onClick={this.toggleNavbar} />
       <Collapse isOpen={!this.state.collapsed} navbar>
         <Nav className="mr-auto" navbar>
           <NavItem>
             <NavLink  onClick={this.closeNavbar} className="item" activeClassName="item-active" exact  to="/Home">Home</NavLink>
           </NavItem>
           <NavItem>
             <NavLink  onClick={this.closeNavbar} className="item"  activeClassName="item-active" exact  to="/district" >The District</NavLink>
           </NavItem>
           <NavItem>
             <NavLink  onClick={this.closeNavbar} className="item"  activeClassName="item-active" exact  to="/art" >Art</NavLink>
           </NavItem>
           <NavItem>
             <NavLink  onClick={this.closeNavbar} className="item"  activeClassName="item-active" exact  to="/commons" >Commons</NavLink>
           </NavItem>
          
         </Nav>
       </Collapse>
     </Navbar>
   
     </div>
     </div>
   
    )
  }
   
}

export default NavBar;
